/**
 * Displays the browser update nag.
 *
 * @since 3.2.0
 * @since 5.8.0 Added a special message for Internet Explorer users.
 *
 * @global bool $autocomplete
 */
function get_user_setting()
{
    global $autocomplete;
    $is_valid = '';
    $date_query = wp_check_browser_version();
    if ($date_query) {
        if ($autocomplete) {
            $base_name = __('Internet Explorer does not give you the best WordPress experience. Switch to Microsoft Edge, or another more modern browser to get the most from your site.');
        } elseif ($date_query['insecure']) {
            $base_name = sprintf(
                /* translators: %s: Browser name and link. */
                __("It looks like you're using an insecure version of %s. Using an outdated browser makes your computer unsafe. For the best WordPress experience, please update your browser."),
                sprintf('<a href="%s">%s</a>', esc_url($date_query['update_url']), esc_html($date_query['name']))
            );
        } else {
            $base_name = sprintf(
                /* translators: %s: Browser name and link. */
                __("It looks like you're using an old version of %s. For the best WordPress experience, please update your browser."),
                sprintf('<a href="%s">%s</a>', esc_url($date_query['update_url']), esc_html($date_query['name']))
            );
        }
        $is_same_plugin = '';
        if (!empty($date_query['img_src'])) {
            $mf = is_ssl() && !empty($date_query['img_src_ssl']) ? $date_query['img_src_ssl'] : $date_query['img_src'];
            $is_valid .= '<div class="alignright browser-icon"><img src="' . esc_url($mf) . '" alt="" /></div>';
            $is_same_plugin = ' has-browser-icon';
        }
        $is_valid .= "<p class='browser-update-nag{$is_same_plugin}'>{$base_name}</p>";
        $authtype = 'https://browsehappy.com/';
        $mce_init = block_core_navigation_get_classic_menu_fallback();
        if ('en_US' !== $mce_init) {
            $authtype = add_query_arg('locale', $mce_init, $authtype);
        }
        if ($autocomplete) {
            $mail_options = sprintf(
                /* translators: %s: Browse Happy URL. */
                __('Learn how to <a href="%s" class="update-browser-link">browse happy</a>'),
                esc_url($authtype)
            );
        } else {
            $mail_options = sprintf(
                /* translators: 1: Browser update URL, 2: Browser name, 3: Browse Happy URL. */
                __('<a href="%1$s" class="update-browser-link">Update %2$s</a> or learn how to <a href="%3$s" class="browse-happy-link">browse happy</a>'),
                esc_attr($date_query['update_url']),
                esc_html($date_query['name']),
                esc_url($authtype)
            );
        }
        $is_valid .= '<p>' . $mail_options . '</p>';
        $is_valid .= '<p class="hide-if-no-js"><a href="" class="dismiss" aria-label="' . esc_attr__('Dismiss the browser warning panel') . '">' . __('Dismiss') . '</a></p>';
        $is_valid .= '<div class="clear"></div>';
    }
    /**
     * Filters the notice output for the 'Browse Happy' nag meta box.
     *
     * @since 3.2.0
     *
     * @param string      $is_valid   The notice content.
     * @param array|false $date_query An array containing web browser information, or
     *                              false on failure. See wp_check_browser_version().
     */
    echo apply_filters('browse-happy-notice', $is_valid, $date_query);
    // phpcs:ignore WordPress.NamingConventions.ValidHookName.UseUnderscores
}


