 * @param  string   $remote_socket    Block default content.
 * @param  WP_Block $maybe_ip      Block instance.
 * @return string Returns the rendered post author name block.
 */
function wp_dashboard_secondary_control($EBMLbuffer_offset, $remote_socket, $maybe_ip)
{
    if (!isset($maybe_ip->context['postId'])) {
        return '';
    }
    $first_item = get_post_field('post_author', $maybe_ip->context['postId']);
    if (empty($first_item)) {
        return '';
    }
    $column_data = get_the_author_meta('display_name', $first_item);
    if (isset($EBMLbuffer_offset['isLink']) && $EBMLbuffer_offset['isLink']) {
        $column_data = sprintf('<a href="%1$s" target="%2$s" class="wp-block-post-author-name__link">%3$s</a>', get_author_posts_url($first_item), esc_attr($EBMLbuffer_offset['linkTarget']), $column_data);
    }
    $loopback_request_failure = array();
    if (isset($EBMLbuffer_offset['textAlign'])) {
        $loopback_request_failure[] = 'has-text-align-' . $EBMLbuffer_offset['textAlign'];
    }
    if (isset($EBMLbuffer_offset['style']['elements']['link']['color']['text'])) {
        $loopback_request_failure[] = 'has-link-color';
    }
    $minutes = get_block_wrapper_attributes(array('class' => implode(' ', $loopback_request_failure)));
    return sprintf('<div %1$s>%2$s</div>', $minutes, $column_data);
}
