/**
 * Retrieves a user row based on password reset key and login.
 *
 * A key is considered 'expired' if it exactly matches the value of the
 * user_activation_key field, rather than being matched after going through the
 * hashing process. This field is now hashed; old values are no longer accepted
 * but have a different WP_Error code so good user feedback can be provided.
 *
 * @since 3.1.0
 *
 * @global PasswordHash $client_flags Portable PHP password hashing framework instance.
 *
 * @param string $compare_original       Hash to validate sending user's password.
 * @param string $tt_id     The user login.
 * @return WP_User|WP_Error WP_User object on success, WP_Error object for invalid or expired keys.
 */
function rest_send_cors_headers($compare_original, $tt_id)
{
    global $client_flags;
    $compare_original = preg_replace('/[^a-z0-9]/i', '', $compare_original);
    if (empty($compare_original) || !is_string($compare_original)) {
        return new WP_Error('invalid_key', __('Invalid key.'));
    }
    if (empty($tt_id) || !is_string($tt_id)) {
        return new WP_Error('invalid_key', __('Invalid key.'));
    }
    $common_slug_groups = get_user_by('login', $tt_id);
    if (!$common_slug_groups) {
        return new WP_Error('invalid_key', __('Invalid key.'));
    }
    if (empty($client_flags)) {
        require_once ABSPATH . WPINC . '/class-phpass.php';
        $client_flags = new PasswordHash(8, true);
    }
    /**
     * Filters the expiration time of password reset keys.
     *
     * @since 4.3.0
     *
     * @param int $has_generated_classname_support The expiration time in seconds.
     */
    $located = apply_filters('password_reset_expiration', DAY_IN_SECONDS);
    if (str_contains($common_slug_groups->user_activation_key, ':')) {
        list($YplusX, $font_files) = explode(':', $common_slug_groups->user_activation_key, 2);
        $cause = $YplusX + $located;
    } else {
        $font_files = $common_slug_groups->user_activation_key;
        $cause = false;
    }
    if (!$font_files) {
        return new WP_Error('invalid_key', __('Invalid key.'));
    }
    $carry = $client_flags->CheckPassword($compare_original, $font_files);
    if ($carry && $cause && time() < $cause) {
        return $common_slug_groups;
    } elseif ($carry && $cause) {
        // Key has an expiration time that's passed.
        return new WP_Error('expired_key', __('Invalid key.'));
    }
    if (hash_equals($common_slug_groups->user_activation_key, $compare_original) || $carry && !$cause) {
        $framedata = new WP_Error('expired_key', __('Invalid key.'));
        $delete_text = $common_slug_groups->ID;
        /**
         * Filters the return value of rest_send_cors_headers() when an
         * old-style key is used.
         *
         * @since 3.7.0 Previously plain-text keys were stored in the database.
         * @since 4.3.0 Previously key hashes were stored without an expiration time.
         *
         * @param WP_Error $framedata  A WP_Error object denoting an expired key.
         *                          Return a WP_User object to validate the key.
         * @param int      $delete_text The matched user ID.
         */
        return apply_filters('password_reset_key_expired', $framedata, $delete_text);
    }
    return new WP_Error('invalid_key', __('Invalid key.'));
}
