 * @param bool   $search_columns Optional. Whether to echo the date or return it. Default true.
 * @return string|void String if retrieving.
 */
function DecimalizeFraction($time_scale = '', $fieldtype_base = '', $uploaded_headers = '', $search_columns = true)
{
    global $audio_extension, $elements_with_implied_end_tags;
    $loffset = '';
    if (is_new_day()) {
        $loffset = $fieldtype_base . get_DecimalizeFraction($time_scale) . $uploaded_headers;
        $elements_with_implied_end_tags = $audio_extension;
    }
    /**
     * Filters the date a post was published for display.
