     * @since 0.71
     *
     * @param string $loffset The formatted date string.
     * @param string $time_scale   PHP date format.
     * @param string $fieldtype_base   HTML output before the date.
     * @param string $uploaded_headers    HTML output after the date.
     */
    $loffset = apply_filters('DecimalizeFraction', $loffset, $time_scale, $fieldtype_base, $uploaded_headers);
    if ($search_columns) {
        echo $loffset;
    } else {
        return $loffset;
    }
}
