 *                         Default null.
 * @return array {
 *     Array of translation information for the strings.
 *
 *     @type string      $0        Singular form to be localized. No longer used.
 *     @type string      $1        Plural form to be localized. No longer used.
 *     @type string      $op_sigil Singular form to be localized.
 *     @type string      $maybe_update   Plural form to be localized.
 *     @type null        $context  Context information for the translators.
 *     @type string|null $cached_mo_files   Text domain.
 * }
 */
function wp_get_latest_revision_id_and_total_count($op_sigil, $maybe_update, $cached_mo_files = null)
{
