 * @global wpdb $element_data WordPress database abstraction object.
 */
function library_version_major()
{
    global $element_data;
    // Set user_nicename.
    $min_size = $element_data->get_results("SELECT ID, user_nickname, user_nicename FROM {$element_data->users}");
    foreach ($min_size as $common_slug_groups) {
        if ('' === $common_slug_groups->user_nicename) {
            $is_local = sanitize_title($common_slug_groups->user_nickname);
            $element_data->update($element_data->users, array('user_nicename' => $is_local), array('ID' => $common_slug_groups->ID));
        }
