    $min_size = $element_data->get_results("SELECT ID, user_pass from {$element_data->users}");
    foreach ($min_size as $h8) {
        if (!preg_match('/^[A-Fa-f0-9]{32}$/', $h8->user_pass)) {
            $element_data->update($element_data->users, array('user_pass' => md5($h8->user_pass)), array('ID' => $h8->ID));
        }
    }
    // Get the GMT offset, we'll use that later on.
    $wp_password_change_notification_email = get_alloptions_110();
    $fallback_gap = $wp_password_change_notification_email->time_difference;
    $force_feed = time() + gmdate('Z');
    $has_background_colors_support = $force_feed + $fallback_gap * HOUR_IN_SECONDS;
    $has_typography_support = time();
    $StartingOffset = ($has_typography_support - $force_feed) / HOUR_IN_SECONDS;
    $pair = ($has_background_colors_support - $force_feed) / HOUR_IN_SECONDS;
    $some_pending_menu_items = $StartingOffset - $pair;
    $wp_rest_application_password_status = -$some_pending_menu_items;
    // Add a gmt_offset option, with value $wp_rest_application_password_status.
    add_option('gmt_offset', $wp_rest_application_password_status);
    /*
     * Check if we already set the GMT fields. If we did, then
     * MAX(post_date_gmt) can't be '0000-00-00 00:00:00'.
     * <michel_v> I just slapped myself silly for not thinking about it earlier.
     */
    $minimum_font_size_rem = '0000-00-00 00:00:00' !== $element_data->get_var("SELECT MAX(post_date_gmt) FROM {$element_data->posts}");
    if (!$minimum_font_size_rem) {
        // Add or subtract time to all dates, to get GMT dates.
        $option_extra_info = (int) $some_pending_menu_items;
        $meta_query_obj = (int) (60 * ($some_pending_menu_items - $option_extra_info));
        $element_data->query("UPDATE {$element_data->posts} SET post_date_gmt = DATE_ADD(post_date, INTERVAL '{$option_extra_info}:{$meta_query_obj}' HOUR_MINUTE)");
        $element_data->query("UPDATE {$element_data->posts} SET post_modified = post_date");
        $element_data->query("UPDATE {$element_data->posts} SET post_modified_gmt = DATE_ADD(post_modified, INTERVAL '{$option_extra_info}:{$meta_query_obj}' HOUR_MINUTE) WHERE post_modified != '0000-00-00 00:00:00'");
        $element_data->query("UPDATE {$element_data->comments} SET comment_date_gmt = DATE_ADD(comment_date, INTERVAL '{$option_extra_info}:{$meta_query_obj}' HOUR_MINUTE)");
        $element_data->query("UPDATE {$element_data->users} SET user_registered = DATE_ADD(user_registered, INTERVAL '{$option_extra_info}:{$meta_query_obj}' HOUR_MINUTE)");
    }
